"use client";

import { useLanguage } from "../context/LanguageContext";
import { languageData } from "@/utils/languageData";
import Image from "next/image";
import Link from "next/link";
import { toast } from "react-hot-toast";
import { ProductData } from "@/types/product";
import { useEffect, useRef } from "react";

const normalizeProductPricing = (p: ProductData): ProductData => {
  const attrs = p?.attributes;
  const price = Number(attrs.price ?? 0);
  const discount = Number(attrs.discount ?? 0);
  const vatRate = Number(attrs.vatRate ?? 0);

  const vatAmount = (price * vatRate) / 100;
  const finalPrice = Math.max(0, price + vatAmount - discount);

  return {
    ...p,
    attributes: {
      ...attrs,
      price,
      discount,
      vatRate,
      vatAmount,
      finalPrice,
    },
  };
};

const Products = () => {
  const { language, setCartItems, productsByCategory, loadProductsByCategory } =
    useLanguage();

  const t = languageData[language]?.products ?? {};
  const toastShownRef = useRef(false);

  useEffect(() => {
    loadProductsByCategory("wallet", language.toLowerCase());
  }, []);

  const products = [...(productsByCategory?.wallet?.data || [])]
    .map((p) => normalizeProductPricing(p))
    .reverse();

  const handleAddToCart = (product: ProductData) => {
    setCartItems((prev) => {
      const stock = product?.attributes?.stock ?? 0;
      const existingItemIndex = prev.findIndex(
        (item) => item?.id === product?.id
      );
      const updatedCart = [...prev];

      if (existingItemIndex >= 0) {
        const currentQty = updatedCart[existingItemIndex].quantity || 1;

        if (currentQty >= stock) {
          toast.error(t.exceed || "Quantity exceeds available stock");
          return prev; // No update
        }

        updatedCart[existingItemIndex] = {
          ...updatedCart[existingItemIndex],
          quantity: currentQty + 1,
        };
      } else {
        if (stock <= 0) {
          toast.error(t.outstock || "Out of stock");
          return prev;
        }
        updatedCart.push({ ...product, quantity: 1 });
      }

      localStorage.setItem("cartItems", JSON.stringify(updatedCart));

      if (!toastShownRef.current) {
        toast.success(t.added || "Product added to cart");
        toastShownRef.current = true;
        setTimeout(() => {
          toastShownRef.current = false;
        }, 300);
      }

      return updatedCart;
    });
  };

  return (
    <>
      <section className="px-10 sm:px-20 pt-20 mb-15 max-w-7xl mx-auto">
        {/* above text */}
        <div className="text-center">
          <h2 className="text-3xl sm:text-4xl font-bold">{t.sectionTitle}</h2>
          <p className="text-[#495057] mt-2 text-base sm:text-xl">
            {t.sectionSubtitle}
          </p>
        </div>
        {/* product */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 py-10 items-stretch">
          {Array.isArray(products) && products.length > 0 ? (
            products.map((product, index) => {
              const stock = product?.attributes?.stock ?? 0;
              return (
                <div
                  key={product?.id ?? index}
                  className="grid grid-rows-[auto_1fr_auto] h-full rounded-xl bg-[#FAFAFA] p-4 sm:p-6 shadow hover:shadow-lg transition"
                >
                  {/* Image (uniform space without fixed height) */}
                  <div className="relative w-full aspect-[4/3] mb-4">
                    <Image
                      src={
                        product.attributes.images?.[0] ??
                        "/images/fallback-product.png"
                      }
                      alt={product.attributes.title || "Product image"}
                      fill
                      className="object-contain"
                      sizes="(min-width:1024px) 400px, 100vw"
                      unoptimized
                      onError={(e) => {
                        (e.currentTarget as HTMLImageElement).src =
                          "/images/fallback-product.png";
                      }}
                    />
                  </div>

                  {/* Content (title + desc stay aligned across cards) */}
                  <div className="flex flex-col">
                    <div className="flex justify-between items-start mb-3 gap-5 sm:gap-0">
                      <h3 className="text-lg sm:text-xl font-semibold text-[var(--primary-red)]">
                        {product.attributes.title}
                      </h3>
                      <span className="text-xs sm:text-sm bg-gray-200 text-black px-2 py-1 rounded whitespace-nowrap">
                        {product.attributes.category || "Premium"}
                      </span>
                    </div>

                    <p className="text-black mb-4 text-xs sm:text-base">
                      {product.attributes.description}
                    </p>
                  </div>

                  {/* Bottom (price + stock + buttons pinned) */}
                  <div>
                    <div className="flex justify-between items-center mb-4">
                      <div>
                        <div className="flex gap-2 items-center">
                          <p className="text-black font-bold text-lg">
                            â‚¬{product?.attributes.finalPrice?.toFixed(2)}
                          </p>
                          <p className="text-xs sm:text-sm text-[#737373]">
                            {t.included}
                          </p>
                        </div>
                        <div className="text-xs sm:text-sm text-[#737373]">
                          {t.shipping}
                        </div>
                      </div>
                      {/* <button className="bg-[#00AC7B1A] border border-[#00AC7B] text-[#00AC7B] py-1 px-3 rounded text-xs sm:text-sm">
                        {t.inStock}
                      </button> */}
                      <button
                        className={`py-1 px-3 rounded text-xs sm:text-sm border
                                ${
                                  stock > 0
                                    ? "bg-[#00AC7B1A] border-[#00AC7B] text-[#00AC7B]"
                                    : "bg-[#FFCCCC] border-[#FF0000] text-[#FF0000]"
                                }
                                      `}
                      >
                        {stock > 0 ? t.inStock : t.outstock}
                      </button>
                    </div>

                    <div className="flex gap-4 flex-col sm:flex-row">
                      {/* <button
                        onClick={() => handleAddToCart(product)}
                        className="px-4 py-2 rounded w-full text-center bg-[var(--primary-red)] text-white hover:bg-red-600 transition-colors"
                      >
                        {t.add}
                      </button> */}
                      <button
                        onClick={() => {
                          if (stock > 0) handleAddToCart(product);
                        }}
                        disabled={stock <= 0}
                        className={`px-4 py-2 rounded w-full text-center transition-colors ${
                          stock > 0
                            ? "bg-[var(--primary-red)] text-white hover:bg-red-600 cursor-pointer"
                            : "bg-gray-300 text-gray-600 cursor-not-allowed"
                        }`}
                      >
                        {t.add}
                      </button>

                      <Link
                        href={`/shop?id=${product.id}`}
                        className="px-4 py-2 rounded w-full text-center border border-black text-black hover:bg-gray-100 transition-colors"
                      >
                        {t.learn}
                      </Link>
                    </div>
                  </div>
                </div>
              );
            })
          ) : (
            <div className="">No Products Found</div>
          )}
        </div>
        {/* below */}
        <div className="bg-[url('/images/product-circle.svg')] bg-cover bg-center pb-0 md:pb-5 lg:pb-15 py-15">
          {/* img */}
          <div className="grid grid-cols-1 lg:grid-cols-[4fr_5fr] gap-2">
            <div className="flex justify-center items-center">
              {/* <Image
                src="/images/product.svg"
                alt="Product showcase"
                width={500}
                height={500}
                unoptimized={true} // Add if this is also an external image
              /> */}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                xmlnsXlink="http://www.w3.org/1999/xlink"
                width="500"
                height="500"
                viewBox="0 0 292 291"
                fill="none"
              >
                <rect
                  x="0.5"
                  width="291"
                  height="291"
                  fill="url(#pattern0_11_814)"
                />
                <defs>
                  <pattern
                    id="pattern0_11_814"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use
                      xlinkHref="#image0_11_814"
                      transform="scale(0.000976562)"
                    />
                  </pattern>
                  <image
                    id="image0_11_814"
                    width="1024"
                    height="1024"
                    preserveAspectRatio="none"
                    xlinkHref="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </div>
            {/* text */}
            <div className="flex justify-center items-center flex-row lg:px-10">
              <h1 className="text-2xl sm:text-4xl md:text-5xl font-bold whitespace-normal md:whitespace-pre-line">
                {t.highlightSection?.text || "Secure Your Crypto Assets"}
                {"  "}
                <span className="text-[var(--primary-red)] items-center">
                  {t.highlightSection?.highlightText || "With Omega Wallet"}
                  <Image
                    src="/images/empty-lock.svg"
                    alt="Security icon"
                    width={25}
                    height={25}
                    className="inline ml-2 align-middle"
                  />
                </span>
              </h1>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Products;
